import React from "react"
import { Link } from "react-router-dom"
import "./navbar.css"
export default class Navbar extends React.Component{
  render(){
    return(
      <nav className="nav">
        <Link className="site-title" to="/">LecSum</Link>
        <ul>
          <li>
            <a href="/about">About</a>
          </li>
          <li>
            <a href="/others">API's and NLP</a>
          </li>
        </ul>
      </nav>
    )
  }
}
